import { useState } from 'react';

const Auth: React.FC = () => {
  const [responseData, setResponseData] = useState<any>(null);
  const authURL = window.location.href; 

  const completeAuth = async () => {
    try {
      const response = await fetch('http://127.0.0.1:8080/auth/twitter/complete', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          authURL: authURL 
        })
      });

      if (!response.ok) {
        throw new Error('Failed to fetch data');
      }

      const data = await response.json();
      setResponseData(data);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  useEffect(() => {
    callEndpoint(); // Call the endpoint immediately when the component mounts
  }, []); // Empty dependency array means it runs only once after initial mount


  return (
    <div>
      <button onClick={callEndpoint}>Call Endpoint</button>
      {responseData && (
        <div>
          <h2>Response Data:</h2>
          <pre>{JSON.stringify(responseData, null, 2)}</pre>
        </div>
      )}
    </div>
  );
};

export default Auth;
